import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import ProductPage from "./pages/ProductPage";
import RawMaterialPage from "./pages/RawMaterialPage";
import ProductRawMaterialPage from "./pages/ProductRawMaterialPage";  

function App() {
  return (
    <Router>
      <nav>
        <Link to="/products">Products</Link>
        <Link to="/product-raw-materials">Associate Raw Materials</Link>
      </nav>
      <Routes>
        <Route path="/products" element={<ProductPage />} />
        <Route path="/raw-materials" element={<RawMaterialPage />} />
        <Route path="/product-raw-materials" element={<ProductRawMaterialPage />} />
      </Routes>
    </Router>
  );
}

export default App;
